post_text:
Jubilee Academies was deemed 100% compliant according to the State Performance Plan (SPP) Indicator 13! Specific schools include Jubilee-Brownsville, Jubilee - San Antonio and Jubilee-Lake View University Prep

This indicator measures the percent of youth 16 years old and above with an Individualized Education Program (IEP) that includes:

•appropriate measurable postsecondary goals that are annually updated and based upon an age appropriate transition assessment;
•transition services, including courses of study, that will reasonably enable the student to meet those postsecondary goals;
•and annual IEP goals related to the student’s transition service needs.

